/**
/* LOGO */
.logoContainer {
  padding: 0px 0px;
  border: 1px solid #C0C0C0;
  border-radius: 5px 5px 5px 5px;
  margin-left: 15px;
  margin-top: 10px;
  background-color: #FFFFFF;
  -webkit-box-shadow: 0px 0px 0px #00347B;
  -moz-box-shadow: 0px 0px 0px #00347B;
  box-shadow: 0px 0px 0px #00347B;
  width: 140px;
  height: 70px;

  background-image:url("http://www.camptocamp.com/wp-content/uploads/agit_2017_Block.png");
  background-repeat: no-repeat;
  background-position: center;
  background-size: 120px auto;
  cursor: default;
}
.logo {
  display: none !important;
}

.mb-element-basesourceswitcher li[data-state='active'] {
     position: static;
     background-color: #578e2a;
     color: #578e2a;
     font-size: 12px;
     font-weight: 800;
     padding: 4px;
     border-right-width: 1px;
     margin-bottom: 5px;
     margin-right: 5px; }

.mb-element-basesourceswitcher li[data-state=''] {
     background-color: #ffffff;
     color: #6fb536;
     font-weight: 800;
     font-size: 12px;
     padding: 4px;
     margin-bottom: 5px;
     margin-right: 5px;
     opacity: 0.4; }

.mb-element-basesourceswitcher li:hover {
     border-color: #6fb536;
     background-color: #6fb536;
     color: #6fb536;
     padding: 4px;
     margin-bottom: 5px;
     margin-right: 5px;
     opacity: 1; }

.mb-element-basesourceswitcher li {
     position: relative;
     border-radius: 3px;
     border: 1px solid;
     border-color: #848484; }

.mb-element-basesourceswitcher li[data-sourceset='111'] {
     background: url("/demo_applications/osm_salzburg.png");
     width: 110px;
     height: 110px; }

.mb-element-basesourceswitcher li[data-sourceset='109'] {
     background: url("/demo_applications/orthofotos_salzburg.png");
     width: 110px;
     height: 110px; }
